import './layout.sass'
import Me from '../../assets/images/me.jpg'

const Layout = () => {
    return (
        <>
        <h1>Layout</h1>
        <div className='hex'>
            <img src={Me} alt="profile pic of me in the shape of a hexagon" />
        </div>
        </>
    )
}

export default Layout
